import 'bootstrap/dist/css/bootstrap.min.css';

const RestaurantCard = (props) => {

    return (
        <div class="row">
        <div class="col">
        <div class="card w-75" key={props.key}>
            <div class="card-body">
                <h6 class="card-title">{props.name}</h6>
                <p class="card-text">{props.address}</p>
            </div>
        </div>
        </div>
        </div>
    );
}
 
export default RestaurantCard;
